"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Contiene macros comunes para las plantillas de mens de navegacin.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Bevat veelvoorkomende macro\'s voor navigatiemenu-sjablonen.</Description><Description language-id=\"hu_HU\">ltalnos makrkat tartalmaz a navigcis men sablonokhoz.</Description><Description language-id=\"pt_BR\">Contm macros comuns para modelos de menus de navegao.</Description><Description language-id=\"de_DE\">Enthlt gelufig Makros fr Navigationsmen-Vorlagen.</Description><Description language-id=\"iw_IL\">       </Description><Description language-id=\"fi_FI\">Sislt yleisi makroja navigaatiovalikon esitysmalleihin.</Description><Description language-id=\"ca_ES\">Cont macros comuns per a les plantilles de men de navegaci.</Description><Description language-id=\"fr_FR\">Contient les macros communs pour les gabarits de menu de navigation.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description></root>','macro',NULL,'ftl','<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_attr_selected = \"\"\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if navItem.isSelected()>\n					<#assign\n						nav_item_attr_selected = \"aria-selected=\'true\'\"\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\" ${nav_item_attr_selected}>\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,32160,NULL,NULL),('92ca7427-7836-e45e-edaa-e5efbcca9587',32162,20152,20116,20120,NULL,20120,NULL,'2018-04-02 18:23:59.696000','2018-04-02 18:23:59.696000',20168,0,32111,'SPLIT-BUTTON-DROPDOWNS-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Botn de divisin de mens desplegables</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Split Button Dropdowns</Name><Name language-id=\"hu_HU\">Oszt gomb legrdlk</Name><Name language-id=\"pt_BR\">Botes Suspensos Separados</Name><Name language-id=\"de_DE\">Split-Button-Dropdowns</Name><Name language-id=\"iw_IL\">    </Name><Name language-id=\"fi_FI\">Jaettu pudotuslistanappi</Name><Name language-id=\"ca_ES\">Mens desplegables amb bot de divisi</Name><Name language-id=\"fr_FR\">Bouton sparer de listes droulantes</Name><Name language-id=\"en_US\">Split Button Dropdowns</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">Bootstrap</Description><Description language-id=\"es_ES\">Displays a dropdown navigation menu with root menu items shown as buttons.</Descri