go</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Lange tekst</Name><Name language-id=\"hu_HU\">Hossz szveg</Name><Name language-id=\"pt_BR\">Texto Longo</Name><Name language-id=\"de_DE\">Langer Text</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Pitkteksti</Name><Name language-id=\"ca_ES\">Text llarg</Name><Name language-id=\"fr_FR\">Texte long</Name><Name language-id=\"en_US\">Long Text</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra el nombre completo de cada idioma (ej.: Espaol)</Description><Description language-id=\"ja_JP\">:)</Description><Description language-id=\"nl_NL\">Toon de volledige naam van iedere taal (bv Spaans).</Description><Description language-id=\"hu_HU\">Megjelenti a teljes nevet az egyes nyelvekhez (pl.: spanyol).</Description><Description language-id=\"pt_BR\">Exibe o nome completo de cada idioma (ex.: Espanhol).</Description><Description language-id=\"de_DE\">Zeigt den vollstndigen Namen jeder Sprache (z.B. Spanisch).</Description><Description language-id=\"iw_IL\">       ( ).</Description><Description language-id=\"fi_FI\">Nytt kokonimen joka kielell (esim. suomeksi).</Description><Description language-id=\"ca_ES\">Mostra el nom complet de cada idioma (per exemple, Catal).</Description><Description language-id=\"fr_FR\">Affiche le nom complet de chaque langue (par exemple: Espagnol).</Description><Description language-id=\"en_US\">Displays the full name of each language (e.g. Spanish).</Description></root>','display',NULL,'ftl','<style>\n	.language-entry-long-text {\n		display: inline-block;\n		padding: 0 0.5em;\n	}\n</style>\n\n<#if entries?has_content>\n	<#list entries as entry>\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"a\"]\n				cssClass=\"language-entry-long-t