INSERT INTO `DDMTemplateVersion` VALUES (32114,20152,20116,20120,NULL,'2018-04-02 18:23:59.302000',32110,0,32112,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Flechas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Pijltjes</Name><Name language-id=\"hu_HU\">Nyilak</Name><Name language-id=\"pt_BR\">Setas</Name><Name language-id=\"de_DE\">Pfeile</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Nuolet</Name><Name language-id=\"ca_ES\">Fletxes</Name><Name language-id=\"fr_FR\">Flches</Name><Name language-id=\"en_US\">Arrows</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra el camino de navegacin en la que todo elemento de navegacin es representado por una flecha con su ttulo y enlace.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toont een klikpad waarin elke navigatie-element wordt weergegeven door een pijltje met de titel en de link.</Description><Description language-id=\"hu_HU\">Egy tvonalat jelent meg, amelyben minden navigcis elemet egy nyl kpvisel a cmkjvel s a linkkel egytt.</Description><Description language-id=\"pt_BR\">Exibe o caminho de navegao no qual todo elemento de navegao  representado por uma seta com seu ttulo e link.</Description><Description language-id=\"de_DE\">Stellt eine Breadcrumbnavigation dar, in der jedes Navigationselement als Pfeil mit Titel und Link angezeigt wird.</Description><Description language-id=\"iw_IL\">              .</Description><Description language-id=\"fi_FI\">Nytt murupolun, miss jokainen navigaatio elementti nytetn nuolella otsikon kanssa ja linkill.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegaci en qu cada element de navegaci est representat per una fletxa amb el seu ttol i enlla.</Description><Description language-id=\"fr_FR\">Affiche un fil d\'ariane dans lequel chaque lment de navigation est reprsent par une flche avec son titre et lien.</Description><Description language-id=\"en_US\">Displays a breadcrumb in which every navigation element is represented by an arrow with its title and link.</Description></root>','ftl','<#if entries?has_content>\n	<@liferay_util[\"html-top\"]>\n		<style>\n			.breadcrumb-arrows li {\n				background-color: #EFEFEF;\n				margin-bottom: 3px;\n				overflow: visible;\n			}\n\n			.breadcrumb-arrows li + li::before {\n				content: none;\n			}\n\n			.breadcrumb-arrows li > a {\n				border-right: 4px solid #FFF;\n				display: block;\n				max-width: 100%;\n				position: relative;\n			}\n\n			.breadcrumb-arrows .entry {\n				line-height: 40px;\n				overflow: hidden;\n				padding-left: 30px;\n				padding-right: 7px;\n				text-overflow: ellipsis;\n				white-space: nowrap;\n			}\n\n			.breadcrumb-arrows a::after {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #EFEFEF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				position: absolute;\n				right: -20px;\n				top: 0;\n				width: 0;\n				z-index: 2;\n			}\n\n			.breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child {\n				border-bottom-right-radius: 4px;\n				border-right-width: 0;\n				border-top-right-radius: 4px;\n				position: relative;\n			}\n\n			.breadcrumb-arrows li:last-child::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child .entry {\n				padding-right: 23px;\n			}\n\n			.breadcrumb-arrows li:first-child {\n				border-bottom-left-radius: 4px;\n				border-top-left-radius: 4px;\n			}\n\n			.breadcrumb-arrows li:first-child::before {\n				border-left-width: 0;\n			}\n\n			.breadcrumb-arrows li:first-child .entry {\n				padding-left: 23px;\n			}\n\n			.breadcrumb-arrows .active {\n				background-color: #007ACC;\n			}\n\n			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {\n				color: #FFF;\n			}\n\n			.breadcrumb-arrows .active a::after {\n				border-left-color: #007ACC;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {\n				border-right-color: #F5F7F8;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-left-color: #F5F7F8;\n			}\n		</style>\n	</@>\n\n	<div class=\"breadcrumb breadcrumb-arrows\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\">\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				<div class=\"entry\">\n					${htmlUtil.escape(entry.getTitle())}\n				</div>\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</div>\n</#if>',0,20120,NULL,'2018-04-02 18:23:59.302000'),(32117,20152,20116,20120,NULL,'2018-04-02 18:23:59.336000',32110,0,32115,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Horizontal</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Horizontaal</Name><Name language-id=\"hu_HU\">Vzszintes</Name><Name language-id=\"pt_BR\">Horizontal</Name><Name language-id=\"de_DE\">Horizontal</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Vaakasuoraan</Name><Name language-id=\"ca_ES\">Horizontal</Name><Name language-id=\"fr_FR\">Horizontal</Name><Name language-id=\"en_US\">Horizontal</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra un camino de navegacin horizontalmente.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toont een klikpad horizontaal.</Description><Description language-id=\"hu_HU\">Egy tvonalat jelent meg vzszintesen.</Description><Description language-id=\"pt_BR\">Exibir o caminho de navegao horizontalmente.</Description><Description language-id=\"de_DE\">Breadcrumbnavigation horizontal anzeigen</Description><Description language-id=\"iw_IL\">   </Description><Description language-id=\"fi_FI\">Nytt murupolun vaakasuoraan.</Description><Description language-id=\"ca_ES\">Mostra una ruta d\'exploraci horitzontalment.</Description><Description language-id=\"fr_FR\">Affiche un fil d\'ariane horizontalement.</Description><Description language-id=\"en_US\">Displays a breadcrumb horizontally.</Description></root>','ftl','<#if entries?has_content>\n	<ul class=\"breadcrumb breadcrumb-horizontal\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\">\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				${htmlUtil.escape(entry.getTitle())}\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</ul>\n</#if>',0,20120,NULL,'2018-04-02 18:23:59.336000'),(32120,20152,20116,20120,NULL,'2018-04-02 18:23:59.352000',32110,0,32118,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Vertical</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Verticaal</Name><Name language-id=\"hu_HU\">Fggleges</Name><Name language-id=\"pt_BR\">Vertical</Name><Name language-id=\"de_DE\">Vertikal</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Pystysuoraan</Name><Name language-id=\"ca_ES\">Vertical</Name><Name language-id=\"fr_FR\">Vertical</Name><Name language-id=\"en_US\">Vertical</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra un camino de navegacin verticalmente.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toont een klikpad verticaal.</Description><Description language-id=\"hu_HU\">Egy tvonalat jelent meg fgglegesen.</Description><Description language-id=\"pt_BR\">Exibir o caminho de navegao verticalmente.</Description><Description language-id=\"de_DE\">Breadcrumbnavigation vertikal anzeigen</Description><Description language-id=\"iw_IL\">   </Description><Description language-id=\"fi_FI\">Nytt murupolun pystysuoraan.</Description><Description language-id=\"ca_ES\">Mostra una ruta d\'exploraci verticalment.</Description><Description language-id=\"fr_FR\">Affiche un fil d\'ariane verticalement.</Description><Description language-id=\"en_US\">Displays a breadcrumb vertically.</Description></root>','ftl','<#if entries?has_content>\n	<ul class=\"breadcrumb breadcrumb-vertical\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\">\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				${htmlUtil.escape(entry.getTitle())}\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</ul>\n</#if>',0,20120,NULL,'2018-04-02 18:23:59.352000'),(32124,20152,20116,20120,NULL,'2018-04-02 18:23:59.376000',32121,0,32122,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Navegacin</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Navigatie</Name><Name language-id=\"hu_HU\">Navigci</Name><Name language-id=\"pt_BR\">Navegao</Name><Name language-id=\"de_DE\">Navigation</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Navigointi</Name><Name language-id=\"ca_ES\">Navegaci</Name><Name language-id=\"fr_FR\">Navigation</Name><Name language-id=\"en_US\">Navigation</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">RSSFeed</Description><Description language-id=\"es_ES\">Muestra los feeds RSS como una barra de navegacin del panel izquierdo. Al hacer clic en un feed se muestra una lista de entradas de feed en el panel derecho.</Description><Description language-id=\"ja_JP\">RSS</Description><Description language-id=\"nl_NL\">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description><Description language-id=\"hu_HU\">Megjelenti az RSS hrcsatornkat navigcis oszlopknt a bal oldalon. Egy hrcsatornra kattintva megjelenti a hrcsatorna bejegyzsek listjt a jobb oldalon.</Description><Description language-id=\"pt_BR\">Exibe os feeds RSS como uma barra de navegao no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id=\"de_DE\">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeintrge im rechten Bereich dargestellt.</Description><Description language-id=\"iw_IL\">   -RSS    .          .</Description><Description language-id=\"fi_FI\">Nytt RSS-sytteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla sytett nytetn sytteen arvot oikeassa paneelissa.</Description><Description language-id=\"ca_ES\">Mostra els canals RSS com una barra de navegaci en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d\'entrades en el tauler dret.</Description><Description language-id=\"fr_FR\">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d\'entres de flux sur le panneau droit.</Description><Description language-id=\"en_US\">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description></root>','ftl','<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-xs-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-xs-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div id=\"tab-${curEntry_index}\" class=\"tab-pane\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index > entriesPerFeed?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												iconCssClass=\"icon-calendar\"\n												label=true\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>',0,20120,NULL,'2018-04-02 18:23:59.376000'),(32128,20152,20116,20120,NULL,'2018-04-02 18:23:59.412000',32125,0,32126,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">Carousel</Name><Name language-id=\"es_ES\">Carrusel</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Carrousel</Name><Name language-id=\"hu_HU\">Krhinta</Name><Name language-id=\"pt_BR\">Carrossel</Name><Name language-id=\"de_DE\">Karussel</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Karuselli</Name><Name language-id=\"ca_ES\">Carrussel</Name><Name language-id=\"fr_FR\">Carrousel</Name><Name language-id=\"en_US\">Carousel</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra imgenes en un carrusel.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Geeft afbeeldingen weer in een carrousel.</Description><Description language-id=\"hu_HU\">Megjelenti a kpeket krhintaszeren.</Description><Description language-id=\"pt_BR\">Exibe imagens num carrossel.</Description><Description language-id=\"de_DE\">Darstellung von Bildern in einem Karussell.</Description><Description language-id=\"iw_IL\">   .</Description><Description language-id=\"fi_FI\">Nytt kuvat karusellissa.</Description><Description language-id=\"ca_ES\">Mostra imatges en format carrusel.</Description><Description language-id=\"fr_FR\">Affiche les images dans un carrousel.</Description><Description language-id=\"en_US\">Displays images in a carousel.</Description></root>','ftl','<#if entries?has_content>\n	<style>\n		#<@portlet.namespace />carousel .carousel-item {\n			background-color: #000;\n			height: 250px;\n			overflow: hidden;\n			text-align: center;\n			width: 700px;\n		}\n\n		#<@portlet.namespace />carousel .carousel-item img {\n			max-height: 250px;\n			max-width: 700px;\n		}\n	</style>\n\n	<div id=\"<@portlet.namespace />carousel\">\n		<#assign imageMimeTypes = propsUtil.getArray(\"dl.file.entry.preview.image.mime.types\") />\n\n		<#list entries as entry>\n			<#if imageMimeTypes?seq_contains(entry.getMimeType())>\n				<div class=\"carousel-item image-viewer-base-image\">\n					<img src=\"${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, \"\")}\" />\n				</div>\n			</#if>\n		</#list>\n	</div>\n\n	<@liferay_aui.script use=\"aui-carousel\">\n		var carousel = new A.Carousel(\n			{\n				after: {\n					responsive: function(event) {\n						event.stopImmediatePropagation();\n\n						var boundingBox = event.currentTarget.get(\'boundingBox\');\n\n						boundingBox.all(\'.image-viewer-base-image-list, .image-viewer-base-image\').setStyles(\n							{\n								height: \'auto\',\n								maxHeight: event.height,\n								maxWidth: event.width,\n								width: \'auto\'\n							}\n						);\n					}\n				},\n\n				contentBox: \'#<@portlet.namespace />carousel\',\n				height: 250,\n				intervalTime: 2,\n				width: 700\n			}\n		).render();\n	</@liferay_aui.script>\n</#if>',0,20120,NULL,'2018-04-02 18:23:59.412000'),(32131,20152,20116,20120,NULL,'2018-04-02 18:23:59.445000',20004,0,32129,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"iw_IL\">  </Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"en_US\">Multi Column Layout</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categoras de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorien eronder.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden sztr szmra. Minden oszlop tartalmazza a sztr nevt, alatta a sztr fels szint kategriival.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulrio. Cada coluna inclui o nome do vocabulrio com as categorias de nvel mais alto listadas abaixo dele.</Description><Description language-id=\"de_DE\">Stellt eine Spalte fr jedes Vokabular dar. Jede Spalte enthlt den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id=\"iw_IL\">     .         ,       .</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaiselle sanastolle. Jokainen sarake sislt sanaston nimen, miss sanaston yltason luokitukset on listattu.</Description><Description language-id=\"ca_ES\">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell ms alta a sota.</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d\'un vocabulaire avec les catgories du niveau racine listes en dessous.</Description><Description language-id=\"en_US\">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary\'s top level categories listed underneath.</Description></root>','ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n					</h3>\n				</div>\n\n				<#assign categories = entry.getCategories() />\n\n				<@displayCategories categories=categories />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20120,NULL,'2018-04-02 18:23:59.445000'),(32134,20152,20116,20120,NULL,'2018-04-02 18:23:59.524000',20168,0,32132,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Men de lista</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Lijstmenu</Name><Name language-id=\"hu_HU\">Lista men</Name><Name language-id=\"pt_BR\">Menu de Lista</Name><