\"iw_IL\">Navigation common macros</Name><Name language-id=\"fi_FI\">Navigation common macros</Name><Name language-id=\"ca_ES\">Macros de navegaci comuns</Name><Name language-id=\"fr_FR\">Macro de menu de navigation</Name><Name language-id=\"en_US\">Navigation common macros</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Contiene macros comunes para las plantillas de mens de navegacin.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Bevat veelvoorkomende macro\'s voor navigatiemenu-sjablonen.</Description><Description language-id=\"hu_HU\">ltalnos makrkat tartalmaz a navigcis men sablonokhoz.</Description><Description language-id=\"pt_BR\">Contm macros comuns para modelos de menus de navegao.</Description><Description language-id=\"de_DE\">Enthlt gelufig Makros fr Navigationsmen-Vorlagen.</Description><Description language-id=\"iw_IL\">       </Description><Description language-id=\"fi_FI\">Sislt yleisi makroja navigaatiovalikon esitysmalleihin.</Description><Description language-id=\"ca_ES\">Cont macros comuns per a les plantilles de men de navegaci.</Description><Description language-id=\"fr_FR\">Contient les macros communs pour les gabarits de menu de navigation.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description></root>','ftl','<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_attr_selected = \"\"\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if navItem.isSelected()>\n					<#assign\n						nav_item_attr_selected = \"aria-selected=\'true\'\"\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\" ${nav_item_attr_selected}>\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20120,NULL,'2018-04-02 18:23:59.680000'),(32164,20152,20116,20120,NULL,'2018-04-02 18:23:59.696000',20168,0,32162,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Botn de divisin de mens desplegables</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Split Button Dropdowns</Name><Name language-id=\"hu_HU\">Oszt gomb legrdlk</Name><Name language-id=\"pt_BR\">Botes Suspensos Separados</Name><Name language-id=\"de_DE\">Split-Button-Dropdowns</Name><Name language-id=\"iw_IL\">    </Name><Name language-id=\"fi_FI\">Jaettu pudotuslistanappi</Name><Name language-id=\"ca_ES\">Mens desplegables amb bot de divisi</Name><Name language-id=\"fr_FR\">Bouton sparer de listes droulantes</Name><Name language-id=\"en_US\">Split Button Dropdowns</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">Bootstrap</Description><Description language-id=\"es_ES\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"hu_HU\">Megjelent egy legrdl navigcis ment Bootstrap gombokkal.</Description><Description language-id=\"pt_BR\">Exibir um menu de navegao dropdown com botes do Bootstrap.</Description><Description language-id=\"de_DE\">Zeigt ein Dropdown-Navigationsmen, wobei die Wurzelelemente als Schaltflchen dargestellt werden.</Description><Description language-id=\"iw_IL\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"fi_FI\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"ca_ES\">Mostra un men de navegaci desplegable amb els elements del men arrel que es mostren com a botons.</Description><Description language-id=\"fr_FR\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"en_US\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description></root>','ftl','<#if !entries?has_content>\n	<#if preview>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-pages-to-display-for-the-current-page-level\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul class=\"navbar-site split-button-dropdowns\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildren = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildren>\n					<#assign\n						nav_item_caret = \"\"\n						nav_item_css_class = \"\"\n						nav_item_href_link = \"\"\n					/>\n\n					<#if navItem.isSelected()>\n						<#assign nav_item_css_class = \"active\" />\n					</#if>\n\n					<#if showChildren>\n						<#assign toggle_text>\n							<@liferay.language key=\"toggle\" />\n						</#assign>\n\n						<#assign nav_item_caret = \"<button aria-expanded=\'false\' aria-haspopup=\'true\' class=\'${nav_item_css_class} btn btn-default dropdown-toggle\' data-toggle=\'dropdown\' type=\'button\'><span class=\'caret\'></span><span class=\'sr-only\'>${toggle_text}</span></button>\" />\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\' ${navItem.getTarget()}\" />\n					</#if>\n\n					<li>\n						<a aria-labelledby=\"layout_${navItem.getLayoutId()}\" class=\"${nav_item_css_class} btn btn-default\" ${nav_item_href_link}><span>${navItem.getName()}</span></a>${nav_item_caret}\n\n						<#if showChildren>\n							<ul class=\"child-menu dropdown-menu\" role=\"menu\">\n								<#list navItem.getBrowsableChildren() as childNavigationItem>\n									<#assign\n										nav_child_attr_selected = \"\"\n										nav_child_css_class = \"\"\n									/>\n\n									<#if childNavigationItem.isSelected()>\n										<#assign\n											nav_child_attr_selected = \"aria-selected=\'true\'\"\n											nav_child_css_class = \"active\"\n										/>\n									</#if>\n\n									<li class=\"${nav_child_css_class}\" id=\"layout_${childNavigationItem.getLayoutId()}\" ${nav_child_attr_selected} role=\"presentation\">\n										<a aria-labelledby=\"layout_${childNavigationItem.getLayoutId()}\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n									</li>\n								</#list>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,20120,NULL,'2018-04-02 18:23:59.696000'),(32167,20152,20116,20120,NULL,'2018-04-02 18:23:59.717000',20008,0,32165,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Color por popularidad</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Kleur op populariteit</Name><Name language-id=\"hu_HU\">Szn npszersg alapjn</Name><Name language-id=\"pt_BR\">Colorir por Popularidade</Name><Name language-id=\"de_DE\">Nach Popularitt frben</Name><Name language-id=\"iw_IL\">  </Name><Name language-id=\"fi_FI\">Vri suosion mukaan</Name><Name language-id=\"ca_ES\">Color per popularitat</Name><Name language-id=\"fr_FR\">Couleur par popularit</Name><Name language-id=\"en_US\">Color by Popularity</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">  (),  (),  ().</Description><Description language-id=\"es_ES\">Muestra las etiquetas de contenido coloreadas segn su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id=\"ja_JP\">:())</Description><Description language-id=\"nl_NL\">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description><Description language-id=\"hu_HU\">Megjelenti a tartalom cmkket npszersg szerint sznezve: vrs (magas), srga (kzepes), s zld (alacsony).</Description><Description language-id=\"pt_BR\">Exibe as tags coloridas por popularidade: vermelho (alta), amarelo (mdia) e verde (baixa).</Description><Description language-id=\"de_DE\">Schlagwrter nach Popularitt frben: Rot (hoch), gelb (mittel), grn (niedrig).</Description><Description language-id=\"iw_IL\">        :  (),  ()  ().</Description><Description language-id=\"fi_FI\">Nytt sislttageja, mitk on vritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virhe (alhainen)</Description><Description language-id=\"ca_ES\">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id=\"fr_FR\">Affiche les tiquettes d\'asset colories par popularit: rouge (lev), jaune (moyen), et vert (bas).</Description><Description language-id=\"en_US\">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description></root>','ftl','<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#assign\n				maxCount = liferay.max(maxCount, entry.getAssetCount())\n				minCount = liferay.min(minCount, entry.getAssetCount())\n			/>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<li class=\"taglib-asset-tags-summary\">\n				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />\n\n				<#if popularity < 1>\n					<#assign color = \"green\" />\n				<#elseif (popularity >= 1) && (popularity < 2)>\n					<#assign color = \"orange\" />\n				<#else>\n					<#assign color = \"red\" />\n				</#if>\n\n				<#assign tagURL = renderResponse.createRenderURL() />\n\n				${tagURL.setParameter(\"resetCur\", \"true\")}\n				${tagURL.setParameter(\"tag\", entry.getName())}\n\n				<a class =\"tag\" style=\"color: ${color};\" href=\"${tagURL}\">\n					${entry.getName()}\n\n					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>\n						<span class=\"tag-asset-count\">(${entry.getAssetCount()})</span>\n					</#if>\n				</a>\n			</li>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>',0,20120,NULL,'2018-04-02 18:23:59.717000'),(32170,20152,20116,20120,NULL,'2018-04-02 18:23:59.745000',20052,0,32168,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"iw_IL\">  </Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"en_US\">Multi Column Layout</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra una columna por cada pgina primaria. Cada columna contiene el nombre de una pgina primaria con las subordinadas inmediatas de esta pgina listadas debajo de ella.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toon een kolom voor elke top level pagina. Elke kolom bevat de naam van een top level pagina met de directe onderliggende pagina\'s eronder.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden fels szint oldal szmra. Minden oszlop tartalmazza a fels szint oldal nevt, alatta a fels szint oldal gyerekvel.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada pgina primria. Cada coluna contm o nome de uma pgina primria com as subordinadas imediatas desta pgina listadas abaixo dela.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte fr jede Seite der obersten Ebene an. Jede Spalte enthlt den Namen der Seite der obersten Ebene sowie die Seiten der direkt untergeordneten Ebene.</Description><Description language-id=\"iw_IL\">      .            .</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaisella yltason sivulla. Jokainen sarake sislt nimen ja yltason sivun, miss alisivut on listattu alla.</Description><Description language-id=\"ca_ES\">Mostra una columna per a cada pgina de nivell superior. Cada columna inclou el nom d\'una pgina de nivell superior amb pgines fill immediates indicades a sota.</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page du niveau racine. Chaque colonne inclut le nom d\'une page du niveau racine avec ses pages enfants listes en dessous.</Description><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description></root>','ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						<a\n\n						<#assign layoutType = entry.getLayoutType() />\n\n						<#if layoutType.isBrowsable()>\n							href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n						</#if>\n\n						>${entry.getName(locale)}</a>\n					</h3>\n				</div>\n\n				<@displayPages pages=entry.getChildren() />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	pages\n>\n	<#if pages?has_content>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<li>\n					<a\n\n					<#assign pageType = page.getLayoutType() />\n\n					<#if pageType.isBrowsable()>\n						href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n					</#if>\n\n					>${page.getName(locale)}</a>\n\n					<@displayPages pages=page.getChildren() />\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20120,NULL,'2018-04-02 18:23:59.745000'),(32174,20152,20116,20120,NULL,'2018-04-02 18:23:59.770000',32171,0,32172,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Icono</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Pictogram</Name><Name language-id=\"hu_HU\">Ikon</Name><Name language-id=\"pt_BR\">cone</Name><Name language-id=\"de_DE\">Symbol</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Ikoni</Name><Name language-id=\"ca_ES\">Icona</Name><Name language-id=\"fr_FR\">Icne</Name><Name language-id=\"en_US\">Icon</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra el icono de la bandera asociada a cada idioma</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toon het pictogram van de vlag verbonden met iedere taal.</Description><Description language-id=\"hu_HU\">Megjelenti az egyes nyelvekhez kapcsold zszlk ikonjait.</Description><Description language-id=\"pt_BR\">Exibe o cone da bandeira associada a cada idioma.</Description><Description language-id=\"de_DE\">Zeigt Flaggensymbole fr jede Sprache.</Description><Description language-id=\"iw_IL\">       .</Description><Description language-id=\"fi_FI\">Nytt lippuikonin liitettyn jokaiseen kieleen.</Description><Description language-id=\"ca_ES\">Mostra la icona de la bandera associada a cada idioma.</Description><Description language-id=\"fr_FR\">Affiche l\'icne du drapeau associ avec chaque langue.</Description><Description language-id=\"en_US\">Displays the icon of the flag associated with each language.</Description></root>','ftl','<#if entries?has_content>\n	<#list entries as entry>\n		<#if entry.isSelected()>\n			<#assign cssClass = \"current-language\" />\n		</#if>\n\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"icon\"]\n				cssClass=cssClass\n				image=entry.getW3cLanguageId()?lower_case\n				markupView=\"lexicon\"\n				message=entry.getLongDisplayName()\n				url=entry.getURL()\n			/>\n		</#if>\n	</#list>\n</#if>',0,20120,NULL,'2018-04-02 18:23:59.770000'),(32177,20152,20116,20120,NULL,'2018-04-02 18:23:59.785000',32171,0,32175,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Men de iconos</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Pictogram menu</Name><Name language-id=\"hu_HU\">Ikon men</Name><Name language-id=\"pt_BR\">Menu de cones</Name><Name language-id=\"de_DE\">Symbolmen</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Ikonivalikko</Name><Name language-id=\"ca_ES\">Icona de men</Name><Name language-id=\"fr_FR\">Menu d\'icne</Name><Name language-id=\"en_US\">Icon Menu</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra un men