INSERT INTO `LayoutPrototype` VALUES (0,'35a2ff5e-c335-6b93-789e-2c13e92b35b1',36181,20116,20120,NULL,'2018-04-02 18:24:54.063000','2018-04-02 18:24:54.063000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Seleccione una pgina de visualizacin</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Kies een weergavepagina</Name><Name language-id=\"hu_HU\">Tartalom megjelent olda</Name><Name language-id=\"pt_BR\">Pgina de Exibio de Contedo</Name><Name language-id=\"de_DE\">Anzeigeseite auswhlen</Name><Name language-id=\"iw_IL\">  </Name><Name language-id=\"fi_FI\">Web-sisllln esityssivu</Name><Name language-id=\"ca_ES\">Escolliu una pgina de presentaci</Name><Name language-id=\"fr_FR\">Choisir une page d\'affichage</Name><Name language-id=\"en_US\">Content Display Page</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Cree, edite y explore contenidos web de esta pgina. Busque contenido adicional, explore contenido relacionado con etiquetas y hojee las categoras del contenido.</Description><Description language-id=\"ja_JP\">Web</Description><Description language-id=\"nl_NL\">U kunt vanaf deze pagina webinhoud aanmaken, bewerken en ontdekken. Zoek beschikbare inhoud, ontdek gerelateerde inhoud met tag en blader door inhoudscategorien.</Description><Description language-id=\"hu_HU\">Hozzon ltre, szerkesszen s fedezzen fel webes tartalmat errl az oldalrl. Keressen elrhet tartalmat, fedezze fel a kapcsold tartalmat cmkkkel s bngsszen tartalomkategrikat.</Description><Description language-id=\"pt_BR\">Crie, edite e explore contedo web a partir desta pgina. Pesquise contedo disponvel, explore o contedo relacionado com tags e navegue as categorias de contedo.</Description><Description language-id=\"de_DE\">Erstellen, bearbeiten und finden von Webcontent dieser Seite. Durchsuchen Sie verfgbare Inhalte, erkunden Sie hnliche Inhalte ber Schlagwrter und durchsuchen Sie Kategorien.</Description><Description language-id=\"iw_IL\">,      .   ,         .</Description><Description language-id=\"fi_FI\">Luo, muokkaa ja tutustu web-sisltn tlt sivulta. Hae saatavilla olevaa sislt, tutustu aiheeseen liittyvn sisltn tunnisteilla ja selaa sisltluokkia.</Description><Description language-id=\"ca_ES\">Crear, editar, i explorar el contingut web des d\'aquesta pgina. Cercar contingut disponible, explorar contingut relacionat amb les etiquetes i navegar per les categories de contingut.</Description><Description language-id=\"fr_FR\">Crer, diter et explorer le contenu web de cette page. Rechercher un contenu disponible, explorer le contenu  l\'aide des tags et parcourir les catgories du contenu.</Description><Description language-id=\"en_US\">Create, edit, and explore web content from this page. Search available content, explore related content with tags, and browse content categories.</Description></root>',NULL,1),(0,'de10e29b-78e0-efdd-b906-5d4a743b8fc2',36254,20116,20120,NULL,'2018-04-02 18:25:08.950000','2018-04-02 18:25:08.950000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">Wiki</Name><Name language-id=\"es_ES\">Wiki</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Wiki</Name><Name language-id=\"hu_HU\">Wiki</Name><Name language-id=\"pt_BR\">Wiki</Name><Name language-id=\"de_DE\">Wiki</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Wiki</Name><Name language-id=\"ca_ES\">Wiki</Name><Name language-id=\"fr_FR\">Wiki</Name><Name language-id=\"en_US\">Wiki</